import React from "react";
import { FaSearch } from "react-icons/fa";
import { FiFilter } from "react-icons/fi";
import "./VacancyComponent.css"

const VacancyComponent = () => {
    return (
      <div className="flex items-center space-x-4">
        {/* Search Bar Container */}
        <div className="flex items-center bg-gray-100 w-[728px] h-[60px] rounded-lg px-4 shadow-sm">
          <FaSearch className="text-gray-500 mr-3" /> {/* Magnifying Glass Icon */}
          <span className="text-gray-600 text-lg">Поиск вакансии</span>
          <button className="ml-auto p-2">
            <FiFilter className="text-gray-600 text-xl" /> {/* Filter Button */}
          </button>
        </div>
        
        {/* Search Button */}
        <button className="w-[364px] h-[60px] bg-blue-400 text-white rounded-lg text-lg font-semibold shadow-md hover:bg-blue-500 transition-all">
          Найти
        </button>
      </div>
    );
  };
  

const [inputText, setInputText] = useState("");

let inputHandler = (e) => {
     var lowerCase = e.target.value.toLowerCase();
};

export default VacancyComponent;
